import React from "react";
import {Howl, Howler} from 'howler';

function Song(file, title) {
  var song = new Howl({
    src: [file]
  })
  var wavesurfer = WaveSurfer.create({
    container: '#waveform'
  });
  return (

    <div>
      <script src="https://unpkg.com/wavesurfer.js"></script>
      <div id = "waveform">
        {wavesurfer.load(file)}
      </div>

    </div>
  );

}

export default Song;
